import React, { Component } from "react";
import offish from "../../assets/images/offish.svg"; // Correct the path to the SVG file

class FeelingProud extends Component {
  render() {
    return (
      <img
        src={offish}
        alt="offish"
        style={{ width: "100%", height: "auto" }}
      />
    );
  }
}

export default offish;
